package com.fashion.binge.fashiondesign.models;import java.io.Serializable;import java.util.List;/** * Created by gokarna on 04/08/16. */public class CategorySearchModel implements Serializable {    private String id;    private String name;    private String image;    private String price;    private List<String> colorList;    private List<String> sizeList;    private String jsonId;    private String wishlist;    private String banner;    private String sellerId;    private String sellerNickName;    private String sellerAvater;    public String getId() {        return id;    }    public void setId(String id) {        this.id = id;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getImage() {        return image;    }    public void setImage(String image) {        this.image = image;    }    public String getPrice() {        return price;    }    public void setPrice(String price) {        this.price = price;    }    public List<String> getColorList() {        return colorList;    }    public void setColorList(List<String> colorList) {        this.colorList = colorList;    }    public List<String> getSizeList() {        return sizeList;    }    public void setSizeList(List<String> sizeList) {        this.sizeList = sizeList;    }    public String getJsonId() {        return jsonId;    }    public void setJsonId(String jsonId) {        this.jsonId = jsonId;    }    public String getWishlist() {        return wishlist;    }    public void setWishlist(String wishlist) {        this.wishlist = wishlist;    }    public String getBanner() {        return banner;    }    public void setBanner(String banner) {        this.banner = banner;    }    public String getSellerId() {        return sellerId;    }    public void setSellerId(String sellerId) {        this.sellerId = sellerId;    }    public String getSellerNickName() {        return sellerNickName;    }    public void setSellerNickName(String sellerNickName) {        this.sellerNickName = sellerNickName;    }    public String getSellerAvater() {        return sellerAvater;    }    public void setSellerAvater(String sellerAvater) {        this.sellerAvater = sellerAvater;    }}